import React from 'react';


function AboutPage() {
    return (
        <section className="h-screen w-full bg-gradient-to-b from-magic-300 to-magic-500 flex items-center justify-between p-28 ">
            <div className="border-2 rounded-xl h-96 w-72"></div>
            <div className="h-96 flex flex-col justify-center bg-red-300 w-[30rem]">
                <div className="px-14 py-1 text-3xl font-bold text-offwhite bg-magic-500">Sobre</div>
            </div>
        </section>
    );
}

export default AboutPage;
